import React from 'react';
import Experience from './Experience/Experience';
import { Box } from '@material-ui/core';

function RightSide(props) {
    return (
        <div>
            <Box borderRadius="1%"
                // justifyContent="center"
                // display="flex"
                boxShadow={1}
                bgcolor="color.paper"
                // m={6}
                // p={2}
                style={{ width: '40rem'}}
                >
            <Experience/>
            </Box>
        </div>
    );
}

export default RightSide;
